import React from "react";
import logo from "../assets/MokxLogo.png";

const Home = () => {
  return (
    <div className="w-full h-full border-2 border-black">
      <h1 className=" text-red-600">Hello</h1>
      <img src={logo} alt="" className="w-[40px] h-[40px]" />
    </div>
  );
};

export default Home;
